import React from "react";
import EducationCard from "./components/education-card";

class Experience extends React.Component {
  render() {
    return (
      <React.Fragment>
        <div className="text-center">
          <h1>EDUCATION</h1>
        </div>
        <div>
          <EducationCard />
        </div>
      </React.Fragment>
    );
  }
}

export default Experience;
